import React from 'react';
import './card-style.css'


class Card extends React.Component {
  render() {
    return (
    	<div className="card-container">
	    	<article className="flashcard">
	    	  <button className="flip-btn">
			  	<label for="toggle-1" className="toggle">
			  		Flip the Card
			  	</label>
			  </button>
			  <input type="checkbox" id="toggle-1" />
			  <div className="blah">
			  	<h5 className="card-title">Ogr√≥d</h5>
			    <h6 className="card-subtitle mb-2 text-muted">Garden</h6>
			    <p className="card-text">My mum likes to work in the garden on Saturdays.</p>
			    <p className="card-text-2">My mum likes to work in the garden on Saturdays.</p>
			    <p className="card-text-2">My mum likes to work in the garden on Saturdays.</p>
			  </div>
			</article>
		</div>
    );
  }
}

export default Card;
